import React from "react";
import { FirstName } from "./Context";

const Child3 = () => {
  return (
    <>
      <FirstName.Consumer>
        {(fname) => {
          return <h1>My name is {fname}</h1>;
        }}
      </FirstName.Consumer>
    </>
  );
};

export default Child3;
